// Utilitaire: trouver un indicatif par code ISO
export const getPhoneCodeByIso = (iso: string) => {
  const row = phoneCodesData.find(r => r.code === iso);
  return row?.phoneCode ?? "";
};

export type PhoneCodeISO = Exclude<typeof phoneCodesData[number]['code'], 'SEPARATOR'>;

